export default function getLineData(data) {
  let profileList = [];

  data['data'].forEach(profile => {
    profileList.push([
      {
        index: "Extension",
        data: (() => {
          try {
            let destruct = profile['data']['pattern'];
            return destruct ? destruct : "";
          }
          catch {return ""};
        })()
      },
      {
        index: "Alerting Name",
        data: (() => {
          try {
            let destruct = profile['data']['alertingName']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Description",
        data: (() => {
          try {
            let destruct = profile['data']['description']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Device",
        data: (() => {
          try {
            let destruct = profile['data']['associatedDevices']['device'][0]
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Primary Line",
        data: (() => {
          try {
            let destruct = profile['data']['lines']['line'][0]['dirn']['pattern']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Forward",
        data: (() => {
          try {
            let destruct = profile['data']['callForwardAll']['destination']
            return destruct ? destruct : ""
          }
          catch {return profile['data']['callForwardAll']['forwardToVoiceMail']}
        })()
      },
      {
        index: "Location",
        data: (() => {
          try {
            let destruct = profile['meta']['hierarchy']
            destruct = destruct.split("London Drugs.")[1]
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      }
    ])
  })

  return new Promise((resolve, reject) => {
    resolve(profileList)
    reject("Unable to retireve devices.")
  })
}
